def hukuri(y, m, p, t) :
    for i in range(y) :
        m += int(m * p) - t
    return m

def tanri(y, m, p, t) :
    risoku = 0
    for i in range(y) :
        risoku += int(m * p)
        m -= t
    return m+risoku

